import React from 'react';
import Link from "next/link";

const NavItem: React.FC<{[key:string]: string}> = ({title, url}) => {
    return (
        <li>
            <Link href={url}>
                <a>{[...title].map(
                        (letter, ind) => letter ?
                            <span
                                style={{transitionDelay: '0.' + ind + 's'}}
                                key={Math.random()}>
                                {letter}
                            </span> : ' ')}
                </a>
            </Link>
            <style jsx>{`
                li {
                    list-style: none;
                    padding: 10px 20px;
                    border-radius: 3px;
                    border: 1px solid grey;
                }
            `}</style>
        </li>
    )
};

export default NavItem;
